It’s a rare gift to photograph the wedding of someone you’ve photographed since they were practically a child (even when perhaps this shows my age a bit!). Seeing how the charming young daughter of a former bride grows into the loveliest of young women and finds her person. I am out in Woodside, CA this weekend, and this place always makes me think of this special family. I photographed Kathy and Adam‘s wedding years ago followed by annual parties and in June went back to my home state of North Carolina to photograph Isabel and Jackson’s wedding. It was everything coming perfectly full circle.  I can’t wait to share more from this special weekend but couldn’t resist posting a few since they’re on my mind while I’m in the spot where it all began. 

