It wasn’t the original plan, but I saw the walls in this room and knew it was the right one. The father of the groom’s study… an unlikely spot to get dressed. Reminded me of the walls in the house where I got engaged and it was of course my color. This family felt like family… and in that way I wanted to place a bit of myself and in some way mark the connection I felt to them on the photographs.  A perfect wedding at home, week before last with @arneywalker — head to stories where I’ll likely over share. 

